            name="firstname" 
            placeholder="Firstname" 
            onChange={(event) =>
                {
                    setFname(event.target.value);       
                }}
            />

            <input type="text" 
            name="lastname"
            placeholder="lastname"
            onChange={(event) =>
                {
                    setLname(event.target.value);       
                }}           
            />

             
            <input type="text" 
            name="city" 
