            onChange={(event) =>
                {
                    setCity(event.target.value);       
                }}           
            />
        <input type="text" 
            name="phone" 
            placeholder="phone"
            onChange={(event) =>
                {
                    setPhone(event.target.value);       
                }}           
            />

    <input type="text" 
            name="salary" 
            placeholder="salary"
            onChange={(event) =>
                {
                    setSalary(event.target.value);       
                }}           
